import React from "react";
import Home from "./pages/Home";
import RecipeList from "./pages/RecipeList";
import RecipeInfo from "./pages/RecipeInfo";
import Contact from "./pages/Contact";
import { BrowserRouter as Router, Route, Link,Switch, Routes } 
       from "react-router-dom";

const App = () => {
  return (
    <Router>  
    <div className="App">  
    <Router>
  <Switch>
    <Route path="/recipe-voice-bot" exact component={Home} />
    <Route path="/recipe-voice-bot/search_recipe" component={RecipeList} />
    <Route path="/recipe-voice-bot/recipe_info" component={RecipeInfo} />
    <Route path="/recipe-voice-bot/contact" component={Contact} />
  </Switch>
</Router>
   </div>  
</Router>  
  );
};

export default App;
